import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { AuthProvider } from "./context/AuthContext";

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <h1>Test App - With AuthProvider</h1>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
